import React from 'react'
import '../Home.css';

import {
    Row,
    Col,
    Image,
    Carousel
} from 'react-bootstrap';

import ScrollMenu from 'react-horizontal-scrolling-menu';

// import AliceCarousel from 'react-alice-carousel';

const DISC_ICON = require('../../../assets/images/home/disconnected-icon.png');
const CONN_ICON = require('../../../assets/images/home/connected-icon.png');
const PROFILE_PHOTO = require('../../../assets/images/home/profile-photo.png');
const INSTA_ICON = require('../../../assets/images/home/insta-icon.png');



export default function Pages() {

    // list of items
const list = [
    { name: 'item1' },
    { name: 'item2' },
    { name: 'item3' },
    { name: 'item4' },
    { name: 'item5' },
    { name: 'item6' },
    { name: 'item7' },
    { name: 'item8' },
    { name: 'item9' }
  ];
  
  // One item component
  // selected prop will be passed
  const MenuItem = ({text, selected}) => {
    renderPageCard();
  };
  
  // All items component
  // Important! add unique key
   const Menu = (list, selected) =>
    list.map(el => {
      const {name} = el;
  
      return <MenuItem text={name} key={name} selected={selected} />;
    });
  
  
  const Arrow = ({ text, className }) => {
    return (
      <div
        className={className}
      >{text}</div>
    );
  };
  
  
  const ArrowLeft = Arrow({ text: '<', className: 'arrow-prev' });
  const ArrowRight = Arrow({ text: '>', className: 'arrow-next' });
  
  const selected = 'item1';

    {/* PAGE CARD */}
    const renderPageCard = () => (
        <Col lg={3} className="p-0 mt-3 mb-3 mr-5">
         <div className="pages-card" style={{backgroundColor: "white"}}>
             <Row className="d-flex">
                 <Image src={DISC_ICON} className="ml-auto" />
             </Row>
             
             <Row className="d-flex">
                 <Col className="d-flex flex-column">
                     <Image src={PROFILE_PHOTO} className="m-auto" />
                     
                     <div className="d-flex" style={{zIndex: 1, marginTop: '-20px'}}>
                         <Col lg={6} />

                         <Col lg={6}>
                             <Image src={INSTA_ICON} className="m-auto" />
                         </Col>
                     </div>
                 </Col>
             </Row>

             <Row className="d-flex mb-3 mt-3">
                 <p className="m-auto pages-card-title" >Instagram page #01</p>
             </Row>

            <Row className="d-flex mt-3">
                <Row className="m-auto justify-content-between">
                     
                    <Col lg={6}>
                        <Col>
                            <p className="m-auto pages-card-title" style={{fontSize: '35px'}}>34.7k</p>
                        </Col>

                        <Col className="d-flex" >
                            <p className="m-auto pages-card-desc-2">Fans</p>
                        </Col>
                    </Col>

                        <Col lg={6}>
                            <Col>
                                <p  className="m-auto pages-card-title" style={{fontSize: '35px'}}>416k</p>
                            </Col>

                            <Col className="d-flex">
                                <p  className="m-auto pages-card-desc-2">Interactions</p>
                            </Col>
                        </Col>
                </Row>
            </Row>
            </div>
        </Col>
    );

    const onSelect = () =>  {
        console.log("on select")
    } 


    return (
        <>
        <Row>
            <p className="home-big-title">Pages Connected</p>
        </Row>

        <Row>
            {renderPageCard()}
        </Row>


        <ScrollMenu
            data={[renderPageCard(),renderPageCard(),renderPageCard(),renderPageCard()]}
            arrowLeft={ArrowLeft}
            arrowRight={ArrowRight}
            selected={selected}
            onSelect={onSelect}
        />           
        </>
    );
    
   
}
